post_content:
Fordele: Eksfolierer huden blidt og holder huden fri for urenheder, sved og bakterier. Samtidig indeholder den beroligende ingredienser, som lindrer en irriteret hud.

Anvendelse: Skummes let op med vand og masseres rundt på de udsatte områder. Skylles af efter brug. Bruges 2-4 gange om ugen eller efter behov.

